import React, { Component } from 'react';
import Content from './Content'
import './App.css';
import infa from './infa'

class App extends Component {
  constructor(props) {
    super(props)

    this.App = null;

    this.setApp = element => {
      this.App = element;
    };

    this.state = {
      getEmail: false,
      infa:{},
    }
  }

  componentDidMount () {

  }

  getEmail = () => {
    this.setState(prevState => ({
      getEmail: !prevState.getEmail,
      infa: infa
    }))
  }

  render() {
    const { getEmail,infa } = this.state
    return (
      <div className="App" ref = {this.setApp}>
        {
          !getEmail ?
            <button onClick={this.getEmail} id="get_button">Get email</button> :
            <Content infa={infa} />
        }
      </div>
    );
  }
}

export default App;
